import './App.css';
import React from "react";
import { useNavigate, Routes, Route } from "react-router-dom";
import homePage from './/components/homePage/homePage.js'

function App() {
  return (
    <div>
      <Routes>
          <Route path="/" element={ <homePage navigate={useNavigate} />} />
      </Routes>
    </div>
  );
}

export default App;
